window.bookSummaryJSON = "<p><b><i>Booktrack Edition</i></b><b> adds an immersive musical soundtrack to your audiobook listening experience! </b></p> <p><b>Essun's missing daughter grows more powerful every day, and her choices may destroy the world in this \"magnificent\" Hugo Award winner and </b><b><i>NYT </i></b><b>Notable Book. (</b><b><i>NPR</i></b><b>)</b></p> <p>The season of endings grows darker, as civilization fades into the long cold night.</p> <p>Essun - once Damaya, once Syenite, now avenger - has found shelter, but not her daughter. Instead there is Alabaster Tenring, destroyer of the world, with a request. But if Essun does what he asks, it would seal the fate of the Stillness forever.</p> <p>Far away, her daughter Nassun is growing in power - and her choices will break the world.</p> <p>N. K. Jemisin's award winning trilogy continues in the sequel to <i>The Fifth Season.</i></p> <p>Booktrack is an immersive format that pairs traditional audiobook narration to complementary music. The tempo and rhythm of the score are in perfect harmony with the action and characters throughout the audiobook. Gently playing in the background, the music never overpowers or distracts from the narration, so listeners can enjoy every minute. When you purchase this Booktrack edition, you receive the exact narration as the traditional audiobook available, with the addition of music throughout.</p>"; 
